import React, {useState} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import styles from './App.css';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import Carousel from 'react-bootstrap/Carousel';
import InputGroup from 'react-bootstrap/InputGroup';
import Card from 'react-bootstrap/Card';


const App = () => {

    return (
        <Container fluid>
            <Row className='firstRowHeader'>
                <Col className='loginBtn'><a href='#'>ورود</a> | <a href='#'>ثبت نام</a></Col>
                <Col><span><a href="#">ساعت کار فروشگاه</a></span></Col>
                <Col><span>شماره تماس : 0842248142</span></Col>
            </Row>
            <Row className='secondRowHeader'>
                <Col> <a href='#'>سبد خرید</a></Col>
                <Col md={6}>
                    <Form>
                        <Form.Control type='text' placeholder='جستجوی کالا' />
                    </Form>
                </Col>
                <Col> <img src={require("./media/img/logo.png")} width={100} /></Col>

            </Row>

        </Container>

    );
}

export default App;
